import "./style.css"
const Musei = () => {
    return ( 
        <div className="Musei">
         
         <div className="r1">
            <div className="photo1">
                <img src="main_page" alt=""/>
            </div>
            <div className="textm">
               <p>Исторический музей</p>
            </div>
         </div>
    
        </div>
        
        
     );
}
 
export default Musei;
